import Layout from '../components/layout';
const index = () => (
    <Layout>
    <div>
        <h2>Welcome to BitzPrice</h2>
    </div>
    </Layout>
);

Index.getInitialProps = async function() {
    const res = await fetch('https://api.coindesk.com/v1/bpi/currentprice.json');
}

export default index;
